import React, { Component } from 'react';
import "./flat.css";

class Flat extends Component {



    render() {

        const title = this.props.flats.price +
            this.props.flats.priceCurrency + " - " +
            this.props.flats.name;

        const style = {
            // Template literals ES6
            backgroundImage: `url('${this.props.flats.imageUrl}')`
        };


        return (
            <div className="flat">
                <div className="flat-picture" style={style}></div>
                <div className="flat-title">{title}</div>
            </div>
        );
    }
}

export default Flat;
